import React from "react";

import "./Main.css"

function Prescription1() {
    return (
        <div className="main">
            <h1>처방전 1</h1>
            <h4>약 목록</h4>
            <div className="medicineBox">
                <p>약명 : 대원알마게이트정</p>
                <p>분류 : 제산제</p>
            </div>
        </div>
    );

}

export default Prescription1;
